import React, { useState, useEffect } from 'react';
import axios from 'axios';

const CommonIngredients = () => {
  const [ingredients, setIngredients] = useState([]);

  const fetchIngredients = async () => {
    try {
      const response = await axios.get('http://http://127.0.0.1:8000/api/common-ingredients/');
      setIngredients(response.data);
    } catch (error) {
      alert('Error fetching ingredients');
    }
  };

  useEffect(() => {
    fetchIngredients();
  }, []);

  return (
    <div>
      <h2>Most Common Ingredients</h2>
      <ul>
        {ingredients.map((ingredient, index) => (
          <li key={index}>{ingredient.ingredients}</li>
        ))}
      </ul>
    </div>
  );
};

export default CommonIngredients;
